import { Component } from '@angular/core';
import { AppButtonComponent } from 'src/app/catalog/common/app-button/app-button.component';

@Component({
  selector: 'app-disc-view-content',
  templateUrl: './app-disc-view-content.component.html',
  styleUrls: ['./app-disc-view-content.component.css'],
  standalone: true,
  imports: [AppButtonComponent],
})
export class AppDiscViewContentComponent {
  yooo() {
    alert('yooo');
  }
}
<div class="app-disc-view-content">
    <div class="app-disc-view-content__inner">
        <app-button color="accent" (click)="yooo()">Yoooo</app-button>
    </div>
</div>
